Description
***********************
Starring Melissa Lauren, Monique Alexander, Alexis Malone, TJ Hart, Katie Morgan, Jack Lawrence, Marco Duato, Tawny Roberts, Tommy Gunn, Manuel Ferrara, Mick Blue, Eric Masterson

Strike a pose. Glam slam for Tawny.

Hollywood's Golden Era may be gone, but not for Tawny Roberts. She still lives the Glam life: the makeup, the gowns, the manners long, slow lovemaking that will pull the eros right out of your soul.

Join award winning director Chi Chi LaRue as he takes you back... and turns you on... to Glamazon. Where they live in the past and lust for the moment! 


